import React, {useContext} from 'react';
import {AnswersDetailsContext, QuesDetailsBoundedContext} from "../../context/renderChecked";

const Slider = ({index}) => {
	const answer = useContext(AnswersDetailsContext)[index];
	const question = useContext(QuesDetailsBoundedContext)[index];


	return (
		<>
			{(!!answer && !!question) && (
				<fieldset disabled>
					<legend><h3>{question.title}</h3></legend>
					<input type="range" id={question.title} value={answer.answer.value.rate} min={0} max={max} step={step}/>
					<label htmlFor={question.title}>{rate}</label>
				</fieldset>
			)}
		</>
	);
};

export default Slider;
